import React, { useContext } from "react";
import { ModelContext } from "../../Context/ModelContext";
import { OrderListContext } from "../../Context/OrderListContext";
import { Link } from "react-router-dom";
import {
  Form,
  Input,
  Button,
  Radio,
  Select,
  Cascader,
  DatePicker,
  InputNumber,
  TreeSelect,
  Switch,
} from 'antd';
import "./Preferential.css";

const Preferential = () => {



  const { setCurrentModel } = useContext(ModelContext);
  const openModel = () => setCurrentModel({ name: "PreferentialModal" });
  const pushOrder = (e) => {
    e.preventDefault();
    console.log(e.target.span)
  }
  return (
    <div className="Pref">
      <div>

      <Form.Item >
          <Button onClick={pushOrder}>Button</Button>
        </Form.Item>
      <input type="button" onClick="alert('Hello World!')" value="Click Me!"></input>
      <input type="button" onClick="alert('Hello World!')" value="Click Me!"></input>
      </div>
      <Link
      onClick={pushOrder}
      detail="test"
      name="test"
        id="Normal"
        className="bt bt-green"
        defaultValue="Normal"

      >
        <h1> NORMAL </h1>
      </Link>

      <Link onClick={openModel} className="bt bt-blue">
        <h1> PREFERENCIAL </h1>
      </Link>
    </div>
  );
};

export default Preferential;
